def getListdept(train,deptCity):
    
    import json

    f = getjsonData()
    data = f #json.load(f)
    # f.close()

    fromCityList, toCityList = [], []
    for fromCity in data[getIndex(train)-1][str(getIndex(train))]["from"]:
        fromCityList.append(fromCity["cityName"])

    for fromCity in data[getIndex(train)-1][str(getIndex(train))]["from"]:
        if fromCity["cityName"] == deptCity:
            toCityList = fromCity["to"]
            break

    return fromCityList

def getListdest(train,deptCity,destCity):
    
    import json

    f = getjsonData()
    data = f #json.load(f)
    # f.close()

    fromCityList, toCityList = [], []
    for fromCity in data[getIndex(train)-1][str(getIndex(train))]["from"]:
        fromCityList.append(fromCity["cityName"])

    for fromCity in data[getIndex(train)-1][str(getIndex(train))]["from"]:
        if fromCity["cityName"] == deptCity:
            toCityList = fromCity["to"]
            break

    return fromCityList,toCityList 

